CREATE TABLE auditoria_salarios (
    CODVEND INTEGER NOT NULL,
    SALARIO_ANTERIOR FLOAT,
    NOVO_SALARIO FLOAT,
    DATA_ALTERACAO DATE
);

-- Gatilho para auditar os salários
CREATE OR REPLACE FUNCTION audit_salarios()
RETURNS TRIGGER AS $$
BEGIN
    IF NEW.SALFIXO <> OLD.SALFIXO THEN
        INSERT INTO auditoria_salarios (CODVEND, SALARIO_ANTERIOR, NOVO_SALARIO, DATA_ALTERACAO)
        VALUES (NEW.CODVEND, OLD.SALFIXO, NEW.SALFIXO, CURRENT_DATE);
    END IF;
    RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER trig_audit_salarios
AFTER UPDATE OF SALFIXO ON VENDEDOR
FOR EACH ROW
EXECUTE PROCEDURE audit_salarios();

-- procedimento armazenado para aumentar os salários 
CREATE OR REPLACE FUNCTION aumentar_salarios()
RETURNS VOID AS $$
BEGIN
    UPDATE VENDEDOR
    SET SALFIXO = CASE 
                    WHEN FAIXACOMIS = 'A' THEN SALFIXO * 1.05
                    WHEN FAIXACOMIS = 'B' THEN SALFIXO * 1.10
                    ELSE SALFIXO * 1.15
                 END;
END;
$$ LANGUAGE plpgsql;

