-- A)  NOVA COLUNA NA TABELA PEDIDO
ALTER TABLE PEDIDO ADD COLUMN QUANTIDADE_ITENS INTEGER;

-- B) PROCEDIMENTO P/ ATUALIZAR O VALOR DESTE ATRIBUTO
CREATE OR REPLACE FUNCTION atualizar_quant_itens(p_numped INTEGER)
RETURNS VOID AS $$
BEGIN
    UPDATE PEDIDO
    SET QUANTIDADE_ITENS = (SELECT COUNT(*) FROM ITEMPED WHERE NUMPED = p_numped)
    WHERE NUMPED = p_numped;
END;
$$ LANGUAGE plpgsql;

-- C) TRIGGER
CREATE OR REPLACE FUNCTION trigger_atualizar_quant()
RETURNS TRIGGER AS $$
BEGIN
    UPDATE PEDIDO
    SET QUANTIDADE_ITENS = (SELECT COUNT(*) FROM ITEMPED WHERE NUMPED = NEW.NUMPED)
    WHERE NUMPED = NEW.NUMPED;
    RETURN NEW;
END;
$$ LANGUAGE plpgsql;

CREATE TRIGGER trig_atualizar_quant
AFTER INSERT OR DELETE ON ITEMPED
FOR EACH ROW
EXECUTE PROCEDURE trigger_atualizar_quant();

