CREATE OR REPLACE FUNCTION verificar_limite()
RETURNS TRIGGER AS $$
BEGIN
    IF (SELECT COUNT(QUANT) FROM ITEMPED WHERE NUMPED = NEW.NUMPED) >= 10 THEN
        RAISE EXCEPTION 'O pedido não pode conter mais do que 10 itens';
    END IF;
    RETURN NEW;
END;
$$ LANGUAGE plpgsql;

DROP TRIGGER trig_verificar_limite_itens ON ITEMPED;
CREATE TRIGGER trig_verificar_limite
BEFORE INSERT ON ITEMPED
FOR EACH ROW
EXECUTE PROCEDURE verificar_limite();


